import axios from 'axios';
import * as Actions from '../actions';



export const FetchTMs = () => {
    return dispatch => {

      axios
      .get("http://localhost:5000/teamMembers")
        .then(res => {
          dispatch(Actions.changeTMList(res.data));
        })
        .catch(err => {
          console.log("ERROR: " + err);
        });
    };
  };

  export const UpdateTime = (newTime) => {
    return dispatch => {
        console.log(newTime);
        dispatch(Actions.changeTimeDelta(1000))
    };
  };

  export const UpdateTime2 = () => {
      return dispatch => {
            const time = Math.floor(Math.random() * 10000) + 1;

            dispatch(Actions.changeTimeDelta(time));
            dispatch(Actions.changeCircle("circle start-rotate"));


            setTimeout(() => {
                dispatch(Actions.changeCircle("circle start-rotate stop-rotate"));
            },time);
          };
  };


